import { useState, useEffect } from "react";

const MostrarProducto = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3001/single_product/")
      .then((res) => res.json())
      .then((data) => setData(data));
  }, []);
  console.log(data);

  const mostrar = data.map((producto) => {
    return (
      <div>
        <h1>PRODUCTO: {producto.nombre}</h1>
        <span>PRECIO: {producto.precio}</span>
        <span>TIPO: {producto.tipo}</span>
        <span>GENERO: {producto.genero}</span>
        <span>GROSORES: {producto.grosores}</span>
        <span>TALLAS: {producto.tallas}</span>
        <span>DESCRIPCION: {producto.descripcion}</span>
        <span>DISEÃ‘O: {producto.design}</span>
        <span>CONCEPCION 3D: {producto.conception}</span>
        <span>CONFORT: {producto.confort}</span>
        <span>IMAGEN 1: {producto.imagenes[0]}</span>
        <span>IMAGEN 2: {producto.imagenes[1]}</span>
        <span>IMAGEN 3: {producto.imagenes[2]}</span>
        <span>IMAGEN 4: {producto.imagenes[3]}</span>
      </div>
    );
  });
  return mostrar;
};

export default MostrarProducto;
